import React, {Component} from 'react';
//import "./arrivalsElement.css";

export default class ArrivalsElement extends Component{
    constructor(props){
        super(props);
    }
    render () {
        const {bookItem} = this.props;
        return(
        <div className="arrivals-elements-card">
            <img className="arrivals-element-img" src={bookItem.image}></img>
            <h4 className="arrivals-element-title">{bookItem.title}</h4>
            <h5 className="arrivals-element-author">{bookItem.author}</h5>
        </div>

        );   
    }
}
